import React from "react";

class Introduction extends React.Component {
	render() {
		return (
			<div className="Introduction">
				<h1 className="Introduction__Greeting">Hello there!</h1>
				<h1 className="Introduction__Name">I'm Abraham.</h1>
				<h1 className="Introduction__Trade">Software Engineer, Graphic Designer, and Web Developer</h1>
			</div>
		);
	}
}

export default Introduction;
